BRASIL tomado de Norte a Sul...a INTELIGENCIA VENCEU,  as estratégias foram aprovadas com êxito...o inimigo comeu a isca...agora é agonizar e morrer...BINGO! A VITÓRIA É NOSSA! Estamos só aguardando o pronunciamento OFICIAL. E no pacote, vão 11 do STF pro inferno, serão nomeados  substitutos pelo TRIBUNAL MILITAR, todos serão PRESOS como traidores da patria, que caberia fuzilamento mas segundo as fontes que Bolsonaro declinou dessa opção. BOLSONARO já sabe quem mandou lhe matar...e no pronunciamento oficial ele ira revelar, o que já foi vazado foi que A GLOBOLIXO E PT estão envolvidos até o pescoço. NO BRASIL tudo pronto pra guerra de qualquer natureza, quem tá fora não entra (SEGURANCA NACIONAL CONTRA INVASÃO EXTERNA) e o pronunciamento oficial só não se deu ainda por questões externas de mercados, em obedecer contratos firmados anteriormente até porque o BRASIL abastece o mundo, fomenta 1/3 da população mundial essa é a UNICA pendência do CAPITÃO, como essas notícias vazadas direto da fonte da FFAA, O prazo pra acontecer seria de no máximo em 17 dias, JA SE PASSARAM 12, Portanto pode sair a qualquer momento inclusive de hoje pra manhã. Abastecam-se, alimento e água...não sabemos quanto tempo vai levar essa derrubada do SISTEMA. Vai rolar sangue, inevitável porque vai ter reação de guerrilheiros, terroristas, e assassinos e esses devem ser ABATIDOS. Estamos numa guerra, e pra fazer omelete tem que se quebrar ovos. Mas pode ter certeza que a VITÓRIA É NOSSA, e as FACÇÕES NAO SOBEM A RAMPA!" 💥💪🏽😎✌️🇧🇷🇧🇷🇧🇷🇧🇷
