2. Em número acumulado de casos, estamos em 5º lugar, mas quando usamos “por milhão” de habitantes, estamos em 98º lugar, com 163.938;

3. Em número de óbitos acumulados, ocupamos a 2ª posição, mas quando usamos “por milhão” de habitantes, estamos em 20° lugar, com 3.203;

